// App.js

import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import HomePage from './components/HomePage';
import SecondaryPage from './components/SecondaryPage';
import ThirdPage from './components/AboutMe';
import SceneCard from './components/SceneCard'; // Import SceneCard component
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import './styles.css'; // Import custom styles

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Rooms</Link>
            </li>
            <li>
              <Link to="/secondary">Scenes</Link>
            </li>
            <li>
              <Link to="/third">About Me</Link>
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/secondary" element={<SecondaryPage />} />
          <Route path="/third" element={<ThirdPage />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
